declare namespace fm.liveswitch {
    /**
     <div>
     An enumeration of potential WebSocket status codes.
     </div>

    */
    enum WebSocketStatusCode {
        /** <span id='prop-fm.liveswitch.WebSocketStatusCode-Normal'>&nbsp;</span> **/
        /**
         <div>
         Indicates normal closure, meaning that the purpose for which
         the connection was established has been fulfilled.
         </div>

        @field Normal
        @type {fm.liveswitch.WebSocketStatusCode}
        */
        Normal = 1000,
        /** <span id='prop-fm.liveswitch.WebSocketStatusCode-GoingAway'>&nbsp;</span> **/
        /**
         <div>
         Indicates that an endpoint is "going away", such as a server
         going down or a browser having navigated away from a page.
         </div>

        @field GoingAway
        @type {fm.liveswitch.WebSocketStatusCode}
        */
        GoingAway = 1001,
        /** <span id='prop-fm.liveswitch.WebSocketStatusCode-ProtocolError'>&nbsp;</span> **/
        /**
         <div>
         Indicates that an endpoint is terminating the connection
         due to a protocol error.
         </div>

        @field ProtocolError
        @type {fm.liveswitch.WebSocketStatusCode}
        */
        ProtocolError = 1002,
        /** <span id='prop-fm.liveswitch.WebSocketStatusCode-InvalidType'>&nbsp;</span> **/
        /**
         <div>
         Indicates that an endpoint is terminating the connection
         because it has received a type of data that it cannot accept.
         </div>

        @field InvalidType
        @type {fm.liveswitch.WebSocketStatusCode}
        */
        InvalidType = 1003,
        /** <span id='prop-fm.liveswitch.WebSocketStatusCode-NoStatus'>&nbsp;</span> **/
        /**
         <div>
         Indicates that no status code was present in the Close frame.
         Reserved for use outside Close frames.
         </div>

        @field NoStatus
        @type {fm.liveswitch.WebSocketStatusCode}
        */
        NoStatus = 1005,
        /** <span id='prop-fm.liveswitch.WebSocketStatusCode-Abnormal'>&nbsp;</span> **/
        /**
         <div>
         Indicates that the connection was closed abnormally, without
         sending a Close frame. Reserved for use outside Close frames.
         </div>

        @field Abnormal
        @type {fm.liveswitch.WebSocketStatusCode}
        */
        Abnormal = 1006,
        /** <span id='prop-fm.liveswitch.WebSocketStatusCode-InvalidData'>&nbsp;</span> **/
        /**
         <div>
         Indicates that an endpoint is terminating the connection
         because it has received data within a message that was not
         consistent with the type of message.
         </div>

        @field InvalidData
        @type {fm.liveswitch.WebSocketStatusCode}
        */
        InvalidData = 1007,
        /** <span id='prop-fm.liveswitch.WebSocketStatusCode-PolicyViolation'>&nbsp;</span> **/
        /**
         <div>
         Indicates that an endpoint is terminating the connection
         because it has received a message that violates its policy.
         </div>

        @field PolicyViolation
        @type {fm.liveswitch.WebSocketStatusCode}
        */
        PolicyViolation = 1008,
        /** <span id='prop-fm.liveswitch.WebSocketStatusCode-MessageTooLarge'>&nbsp;</span> **/
        /**
         <div>
         Indicates that an endpoint is terminating the connection
         because it has received a message that is too big for it
         to process.
         </div>

        @field MessageTooLarge
        @type {fm.liveswitch.WebSocketStatusCode}
        */
        MessageTooLarge = 1009,
        /** <span id='prop-fm.liveswitch.WebSocketStatusCode-UnsupportedExtension'>&nbsp;</span> **/
        /**
         <div>
         Indicates that the client is terminating the connection
         because it has expected the server to negotiate one or
         more extensions, but the server didn't return them in the
         response message of the WebSocket handshake.
         </div>

        @field UnsupportedExtension
        @type {fm.liveswitch.WebSocketStatusCode}
        */
        UnsupportedExtension = 1010,
        /** <span id='prop-fm.liveswitch.WebSocketStatusCode-UnexpectedCondition'>&nbsp;</span> **/
        /**
         <div>
         Indicates that the server is terminating the connection
         because it encountered an unexpected condition that
         prevented it from fulfilling the request.
         </div>

        @field UnexpectedCondition
        @type {fm.liveswitch.WebSocketStatusCode}
        */
        UnexpectedCondition = 1011,
        /** <span id='prop-fm.liveswitch.WebSocketStatusCode-SecureHandshakeFailure'>&nbsp;</span> **/
        /**
         <div>
         Indicates that the connection was closed due to a failure
         to perform a TLS handshake. Reserved for use outside Close
         frames.
         </div>

        @field SecureHandshakeFailure
        @type {fm.liveswitch.WebSocketStatusCode}
        */
        SecureHandshakeFailure = 1015
    }
}
